// En StudentList.tsx
import React from 'react';

interface Student {
  _id: string;
  name: string;
  email: string;
  learningStyle: string[]; // AsegÃºrate de definir learningStyle como un array de strings
}

interface StudentListProps {
  students: Student[];
  onDelete: (studentId: string) => void;
}

const StudentList: React.FC<StudentListProps> = ({ students, onDelete }) => {
  return (
    <div>
      {students.map((student) => (
        <div key={student._id}>
          <h2>{student.name}</h2>
          <p>{student.email}</p>
          <p>{Array.isArray(student.learningStyle) ? student.learningStyle.join(', ') : student.learningStyle}</p>
          <button onClick={() => onDelete(student._id)}>Delete</button>
        </div>
      ))}
    </div>
  );
};

export default StudentList;
